		Scanner sc = new Scanner(System.in);

		int i;
		int ar[] = new int[100];

		int idx = 0;

		while ( sc.hasNext() ) {
			int n = sc.nextInt();
			i = idx - 1;
			while (i >= 0 && n < ar[i]) {
				ar[i + 1] = ar[i];
				--i;
			}
